import React from 'react';

function AddMenuItem(){
    return (<div>
        <h1>Add Menu Item</h1>
        <form>
            <input 
                type="file" 
                accept="image/png, image/jpeg, image/svg+xml"
            />
            <input type="text" placeholder="Title" />
        </form>
    </div>);
}

export default AddMenuItem;
